window.bookSummaryJSON = "Three years have passed since Sherlock Holmes and his nemesis Moriarty vanished into the abyss of the Reichenbach Falls. In that time the criminals of London have been able to sleep safe in their beds. <p> But the capital has never been in greater need of its protector. And so it is that Dr Watson meets a mysterious deformed man who reveals the truth behind the fateful final conflict between Holmes and Moriarty, and paves the way for the extraordinary return of the world's greatest sleuth in these thirteen tales of mystery and deduction:</p> <p> The Empty House<br> The Norwood Builder <br> The Dancing Men <br> The Solitary Cyclist <br> The Priory School <br> Black Peter <br> Charles Augustus Milverton <br> The Six Napoleons <br> The Three Students <br> The Golden Pince-Nez <br> The Missing Three-Quarter <br> The Abbey Grange <br> The Second Stain</p>"; 
